import {Redirect, Route} from "react-router";


const ErrorRoute = ({security}) => {

    if (security.validToken === false) {
        <Redirect to={"/landing"}/>
    }
    return (
        <div>
            <h1>Sorry we are unable to find your page</h1>
        </div>
    );
};

export default ErrorRoute;
